import React from 'react';
import { useTranslation, withTranslation, Trans } from 'react-i18next';
import '../styles/App.scss';

function AboutUs() {
    
    const { t, i18n } = useTranslation();
    return (
        <>
           <div className="containerAbout">
               <div className="titleAbout">
                   <h1>About Us</h1>
                   <h4>Somos un equipo con presencia en México desde hace más de 6 años, tenemos varios puntos de entrenamiento, cada uno líderado por un miembro destacado de nuestro equipo, conócelos.</h4>
               </div>
               <div className="miguelAbout"></div>
               <div className="instructorsAbout"></div>
           </div>
        </>
    )
}

export default AboutUs;
